import React, { Component } from 'react';
import { MENU_LINKS } from './constants';

export default class Menu extends Component {
  render() {
    return (
      <div>
        {MENU_LINKS.map(link => (
          <div className="link">{link.title}</div>
        ))}
      </div>
    );
  }
}
